import React from 'react';

function About() {
  return (
    <section class="about" id="about">
    <div class="container flex-center" id="about-container">
        <h2 class="section-title" id="about-title">About Me</h2>
        <div class="con">
            <div class="text-container">
                <h3>I'm a lead <span>Web Developer</span> based in <span>Helsinki</span> willing to be a Full stack Developer in future. I create stunnig, eye-catching and user-friendly websites. I am highly experienced in web design and development.</h3>
            </div>
        </div>
    </div>
</section>
  );
}

export default About;
